import React from "react";
import { MainPhotoContainer } from "./main-photo.styles";
import photo from "./../../assests/photo.png";
export const MainPhoto = () => {
  return (
    <MainPhotoContainer>
      <BackgroundImageContainer className="background-image" src={photo} />
    </MainPhotoContainer>
  );
};
